import React from "react";
import "../index.css";

function Navbar() {
  return (
    <div>
      <ul className="nav-links">
        <li>
          <a>Login</a>
        </li>
        <li>
          <a>Home</a>
        </li>
        <li>
          <a>Profile</a>
        </li>
      </ul>
    </div>
  );
}

export default Navbar;
